__NUXT_JSONP__("/drugs/Anti-HER2_Immune_Stimulator-antibody_Conjugate_NJH395", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"An immune stimulator-antibody conjugate (ISAC) composed of a monoclonal antibody targeting human epidermal growth factor receptor 2 (EGFR2; HER2; ErbB2) conjugated to a not yet disclosed immune stimulator, with potential antineoplastic and immunostimulating activities. Upon administration of the anti-HER2 immune stimulator-antibody conjugate NJH395, the antibody moiety targets and binds to HER2 expressed on tumor cells. Upon antibody\u002Fantigen binding, the immune-stimulating moiety may, through an as of yet undisclosed mechanism, enhance the immune-mediated killing of HER2-expressing tumor cells. HER2, a tyrosine kinase receptor, is overexpressed in many cancer types and plays a key role in tumor cell proliferation and tumor vascularization.",fdaUniiCode:"301EY96MDU",identifier:"C160349",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C155712"],synonyms:["Anti-HER2 ISAC NJH395",c,"NJH 395","NJH-395","NJH395"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FAnti-HER2_Immune_Stimulator-antibody_Conjugate_NJH395",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Anti-HER2_Immune_Stimulator-antibody_Conjugate_NJH395","Anti-HER2 Immune Stimulator-antibody Conjugate NJH395","2021-10-30T13:35:04.443Z")));